            {client.First_name + " " + client.Surname}
          </div>
          <Button style={{ width: 100, marginLeft: 10, borderRadius: 20 }}
            onClick={this.handleShowCard.bind(this, client.id)}
            variant="success">
            Card
          </Button> */}
          {/* <Button style={{ width: 100, marginLeft: 15, borderRadius: 20 }}
            onClick={this.handleDelete.bind(this, client.id)}
            variant="danger">
            Delete
